INSERT INTO `hospitalcomment` VALUES (1,5,'이대서울병원','최고의 의료진이라고 생각합니다.'),(2,17,'이대목동병원','친절하게 진료봐주십니다.'),(3,7,'고려대학교구로병원','한 달 전 예약 필수.'),(4,2,'한림대학교강남성심병원','약이 독해요.'),(5,10,'서울특별시보라매병원','집 앞이라 편하게 자주 갑니다.'),(6,14,'중앙대학교병원','다른 병원이랑 다르게 점심시간이 2시간이에요.'),(7,3,'가톨릭대학교서울성모병원','친절하십니다.'),(8,18,'삼성서울병원','전화 진료 가능해요.'),(9,15,'강남세브란스병원','전화로만 예약가능합니다.'),(10,11,'서울아산병원','하루 전 예약문자에 답장 안 하면 예약 취소라는 점 주의해야 할 것 같아요.'),(11,12,'강동경희대학교의대병원','좋아요.'),(12,13,'강동성심병원','좋습니다.'),(13,4,'순천향대학교부속서울병원','이화연 선생님 추천합니다.'),(14,19,'한양대학교병원','원래 진료하던 사람 아니면 예약이 힘들어요.'),(15,1,'건국대학교병원','불친절합니다.'),(16,9,'연세암병원','매 진료마다 의사가 바뀌어서 불편합니다.'),(17,16,'서울대학교병원','여기로 옮기고 많이 호전됐어요.'),(18,8,'강북삼성병원','이배꽃 선생님 친절하시고 잘 봐주세요.'),(19,6,'국립중앙의료원','항상 진료 오래 봐주시고, 환자 한 분마다 신경써주시는 것 같아요.'),(20,20,'고려대학교안암병원','약값이 다른 곳에 비해 비싼 것 같습니다.'),(21,2,'노원을지대학교병원','건물이 넓어서 길 찾기가 복잡한데, 프론트에 문의하면 친절하게 알려주십니다'),(22,5,'인제대학교상계백병원','예약 안 하면 아예 진료가 불가능해요'),(23,8,'한국원자력의학원원자력병원','친절하신 것 같아요.');
